import React from 'react';
import Logo from "../assets/logo.svg";

const Header = () => {
  return <header className='bg-pink-200 py-8'>
    <div className='container mx-auto'>
      <div>
        <a href='#'>
          <img src={Logo} alt=''/>
        </a>

        <button className='btn btn-sm'></button>
      </div>
    </div>
  </header>;
};

export default Header;
